                    <li className="navbar-brand">
                     <a className="navbar-brand" href="/Home">
                      <img src="pharmacylogo.png" width="100%" height="100%" className="floatright" alt=""></img>
                    </a>
                     </li>
                        <h1 className="text-center mb-3">
                            <i className="fas fa-sign-in-alt">
                            </i>
                Add medicine order
                </h1>
                    {/* <div className="form-group">
                            <label>medicineid</label>
                            <input
                                type="number"
                                id = "medicineid"
                                className="form-control"
                                onChange = {this.handlemedicineidChange}
                           />
                        </div> */}
                         <div>
                 <DateTimePicker
                      onChange={this.onChange}
                        value = {value}
                              />
                         </div>


                        <div className="form-group">
                            <label>userid</label>
                            <input
                                type="number"
                                id = "userid"
                                className="form-control"
                                onChange = {this.handleuseridChange}
                           />
                        </div>

                        {/* <div className="form-group">
                            <label>address</label>
                            <input
                                type="address"
                                className="form-control"
                                onChange= {this.handleAddressChange}
                         />
                        </div> */}


                 
                        <div>
                         <img src="PharmacyDesign.jpg" width = "100% height = 100%"></img>
                          </div>
                        <button
                            id="1"
                            name="btn"
                            type="submit"
                            onClick= {this.addOrderHandler}
                            className = "btn btn-dark btn-block"
                        >
                            Add New Lab test
                            
                        </button>

                        

                 </div>
                 </div >
                 </div > 
                 
    );
    }

}


export default LabtestAddOrder;
